var codesEl,jsonData=[{name:"FAQ Question #1",code:"More information coming soon...",tag:"faq-tag",more:""},{name:"FAQ Question #2",code:"We're working on a really thorough answer to this FAQ question.",tag:"faq-tag",more:"Read more >>"},{name:"flipkart",code:"kjqwherklq",tag:"faq-tag",more:""},{name:"flipkart",code:"qmbewnqbwe",tag:"faq-tag",more:""},{name:"flipkart",code:"zzvzxcvvnmz",tag:"faq-tag",more:""},{name:"ebay",code:"tyjutynf",tag:"faq-tag",more:""},{name:"ebay",code:"asgcmngjhjser",tag:"faq-tag",more:""}];function printData(e){for(var t=0;t<e.length;t++)`${e[t].more}`!==""&&console.log(`read more for ${e[t].name} is not empty`),codesEl.innerHTML+=`<div class="faqR"><h5 class="faqQ">${e[t].name}</h5><p class="faqA">${e[t].code}</p><a target="_blank" href="/tags/#${e[t].tag}"><span class="faqT">${e[t].tag}</span></a></div>`}function search(e){var t=e.target.value;codesEl.innerText=null,printData(jsonData.filter(e=>{var n=new RegExp(t,"i");return e.name.match(n)||e.code.match(n)}))}window.onload=function(){codesEl=document.getElementById("codes"),printData(jsonData)}